import logo from './logo.svg';
import { BrowserRouter, Routes, Route } from "react-router-dom";
//import { Layout } from './components/layout/Layout';
import Home from "./components/pages/home/Home";
import HomeTwo from "./components/pages/home2/HomeTwo";
import HomeThree from "./components/pages/home2/HomeThree";
import HomeFour from './components/pages/home2/HomeFour';
import HomeFive from './components/pages/home2/HomeFive';
import HomeSix from './components/pages/home2/HomeSix';

import Register from "./components/pages/register/Register";
import Borrow from "./components/pages/borrow/Borrow";

import './App.css';
import { useState } from 'react';
function App(props) {
  const [contract,setContract] = useState(null);
  const [signer, setSigner] = useState(null);

  return (
    <BrowserRouter>
      <Routes>

        <Route path="/" element={<Home />} />

        <Route path="home2" element={<HomeTwo/>}/>
        <Route path="home3" element={<HomeThree/>}/>
        <Route path="home4" element={<HomeFour/>}/>
        <Route path="home5" element={<HomeFive/>}/>



        <Route path="home6" element={<HomeSix/>}/>
        <Route path={`/register/`} element={<Register />} />
        <Route path={`/borrow/`} element={<Borrow />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
